import React from 'react';

function UserList(){
    const users = [
        {
            id:1,
            username:'likelion1',
            email:'likelion1@gmail.com'
        },
        {
            id:2,
            username:'likelion2',
            email:'likelion3@gmail.com'
        },
        {
            id:3,
            username:'likelion3',
           email:'likelion3@gmail.com'
        }
    ];
    return(
        <div>
            <div>
                <b>{users[0].username}</b><span>({users[0].email})</span>
            </div>
            <div>
                <b>{users[0].username}</b><span>({users[1].email})</span>
            </div>
            <div>
                <b>{users[0].username}</b><span>({users[2].email})</span>
            </div>
        </div>
    );
}


export default UserList;
